import React from "react";
import "./footer.styles.css";

const Footer = () => {
  return (
    <div className="footerContainer">
      <h2 className="send">SEND</h2>
      <h1 className="send">ENTER THE PETIVERSE</h1>
      <input type="textInput" placeholder="Email"></input>
      <h3 className="Instagram">Instagram</h3>
      <h3 className="Facebook">Facebook</h3>

      <h3 className="About Us">About Us</h3>
      <h3 className="Mission&Vision">Mission and Vision</h3>
      <h3 className="Community">Community</h3>
      <h3 className="Security&Privacy">Security and Privacy</h3>
      <h3 className="TermsOfUse">Terms of Use</h3>

      <h3 className="Contact Us">Contact Us</h3>
      <h3 className="Shipping">Shipping</h3>
      <h3 className="Returns">Returns</h3>
    </div>
  );
};

export default Footer;
